class DoFn {
public:
    virtual ~DoFn() = default;
};

class ParDoBound : public DoFn {
public:
    virtual DoFn* getFn() = 0;
};

class ParDoBoundMulti : public DoFn {
public:
    virtual DoFn* getFn() = 0;
