namespace Decks {
    std::string strip(const std::string& s) {
        std::string result;
        size_t i = 0, n = s.size();
        while (i < n && (s[i] == '\n' || s[i] == '\t' || s[i] == ' ')) ++i;
        size_t j = n;
        while (j > i && (s[j - 1] == '\n' || s[j - 1] == '\t' || s[j - 1] == ' ')) --j;
        for (size_t k = i; k < j; ++k) {
            if ( (s[k] == '\n' || s[k] == '\t' || s[k] == ' ')
                 && k+1 < j
                 && (s[k+1] == '\n' || s[k+1] == '\t' || s[k+1] == ' ') )
                continue;
            result += s[k];
        }
        return result;
    }
}

