        return o1->getPriority() < o2->getPriority();
    };
    std::sort(steps.begin(), steps.end(), commitStepSorter);

    std::vector<std::shared_ptr<CommitStep>> sequence;
    for (const auto& entity : steps) {
        sequence.push_back(entity->getStep());
    }
    return sequence;
}

